import './Footer.css'

export default function Footer() {
  return (
    <nav id="footer">
	    <a href="https://www.linkedin.com/in/cooperbocko">linkedin</a>
	    <a href="https://github.com/cooperbocko">github</a>
	    <a href="mailto:cooperbocko@gmail.com">email</a>
    </nav>
  )
}
